import Main from "./Main";

const Home = () => {
  return (
    <div className="h-auto w-full bg-gradient-to-r from-indigo-500 via-purple-500 to-pink-500 ...">
      <div className="flex justify-center">
        <Main />
      </div>
    </div>
  );
};

export default Home;
